bool can(int *b,int now)
{
	int cc=0;
	
	
int nn=now;
while(nn)
{
	cc++;
	nn/=10;	
}


	for(int i=0;i<cc;i++)
	{
		
		if(b[i+1]==1&&((now&(1<<i)))==0) return 0;
		if(b[i+1]==0&&((now&(1<<i))>0)) return 0;
		
	}

	return 1;
}
